content:
질투난다고 상대방한테 성희롱해도 되나..; 
&#x27;아~나한테 관심 있어서 성희롱하는구나~&#x27;
라고 이해해 줘야함?게다가 그냥 막말도 아니고 성희롱 급을? 그리고 질투라기 보다는 여자주인공이 오지랖부리니까 짜증나서 필터링 안거치고 막말한걸로 보이는데요

꺄앙&gt;&lt; 
작가님 푹 쉬시구 오세용 
애독자들은 기다리고 있을게요 : )

둘이 행복해져라 얍ㅎㅎ
와중에 아저씨 왜이리 무섭지
사연있는거 같긴한데 ;_;

마지막 ㅡ아내의유혹ㅡ버전인가요?ㅎㅎㅎㅎ
&quot;정시인 가만안둘거야~~~~~&quot;
&quot;복수 할거야~~&quot;
여주야  얼굴점1나 찍자ㅋㅋㅋ

결혼하고 나이 들어갈수록 주변에 친구.지인들은  조금씩 정리되어 갑니다. 

&#x27;늙어서까지 평생 진심으로 함께해준 친구 1명만 있어도 인생 헛 산거 아니다&#x27;
란 말 괜히 있는거 아닙니다

힘든건 힘든거고 힘듬 때문에 좋은사람 놓치는거 그게 제일 바보같은 짓이야;
어쩔 수 없이 라는말을 사람들은 그냥 쉬운단어라고만 생각하는듯;
나중에도 또 어쩔 수 없이 헤어지고 버리고 도망가고 ;;

다 음웹툰 진짜;;
금 요일웹툰을 목요일에 올려주면 어떡합니까.. 때문에 일찍자서
바 른생활 하게 됐잖아요..
리(이) 이제 다음웹툰만 볼게요;;

다: 다음 웹툰이 뭐냐 무섭냐하면
금: 금방 중독되서 너도 모르게 미리보기 하고있어.. 난
바: 바지에 동전한푼도 없다니깐 진짜야; 
리: 이건 중독이야;

만우절거짓말인줄 알았더니.....
진지빨았네 다음이;;;;;
그거에 속은건가.....

다 다 지금 뭐하세요;;
금 금쪽같은 시간에
바 바로바로 댓글에 다금바리 되고싶다고
리 이실직고 하지않고 뭐하세요;;

다:시 사랑은 하지 않을거야.
금:방 시들었던 사랑들, 대체 나에게 무슨 문제가 있는걸까?
&quot;바:보야! 내가 있을 때 다음웹툰 보지말랬지! 
        자기, 날 좋아하긴 하는거야?&quot;
&quot;리:것만 보고!! 되게 중요한 내용이 나와!
        우리 잔깜 있다가 데이트하자.&quot;
